import React from "react";

export const DownloadExcel = () => {
  const downloadSampleExcel = () => {
    const downloadLink = document.createElement("a");
    downloadLink.href = "/sample.xlsx"; // Path to your Excel sheet
    downloadLink.download = "sample.xlsx"; // Desired download file name
    downloadLink.click();
  };

  return (
    <div className="App">
      <h1>Sample Excel Download</h1>
      <button onClick={downloadSampleExcel}>Download Sample Excel</button>
    </div>
  );
};
